import { Injectable } from '@nestjs/common';
import Locadora from './domain/Locadora';

@Injectable()
export class AppService {

  private locadoras = [];

  getHello(): string {
    return 'Hello World!';
  }


  listarLocadoras(){

  
    this.locadoras.push(new Locadora("Movida", "https://cdn2.rcstatic.com/images/supplier_logos/movida_logo_lrg.gif"))
    this.locadoras.push(new Locadora("Localiza","data:image/png;base64,"))
    return this.locadoras

  }
}
